### Static Variables

1. **Scope and Lifetime**:
   - **Local Static Variables**: When a variable is declared `static` inside a function, it retains its value between function calls. The variable is initialized only once, the first time the function is called. Its lifetime is the entire duration of the program.
   - **Global Static Variables**: When a variable is declared `static` outside of any function, it has file scope, meaning it is accessible only within the file it is declared in. It also has a lifetime of the entire program.

2. **Initialization**:
   - Static variables are initialized to zero if not explicitly initialized.

3. **Memory Allocation**:
   - Static variables are stored in the data segment of the memory, not on the stack.

4. **Example**:
   ```c
